use std::f32;

#[derive(Clone, Copy)]
pub struct Point {
    pub x: f32,
    pub y: f32,
}

impl Point {
    #[inline]
    pub fn new(x: f32, y: f32) -> Self {
        Self { x, y }
    }

    #[inline]
    pub fn max(&self, p: Point) -> Self {
        Self {
            x: self.x.max(p.x),
            y: self.y.max(p.y),
        }
    }
}

pub struct Text {
    points: Vec<Point>,
    hi: Point,
}

impl Text {
    pub fn new() -> Self {
        Self {
            points: Vec::new(),
            hi: Point::new(0., 0.),
        }
    }

    pub fn push(&mut self, digit: i64) -> &mut Self {
        let mut hi = self.hi;
        for p in POINTS[digit as usize].iter()  {
            let q = Point::new(p.0 + self.hi.x, p.1);
            self.points.push(q);
            hi = hi.max(q);
        }
        self.hi = hi;
        self.hi.x += 0.1; // some space between digits
        self
    }

    pub fn scale(mut self, s: f32) -> Self {
        for p in self.points.iter_mut() {
            p.x *= s;
            p.y *= s;
        }
        self.hi.x *= s;
        self.hi.y *= s;
        self
    }

    pub fn center(mut self, center: Point) -> Self {
        for p in self.points.iter_mut() {
            p.x += - self.hi.x / 2. + center.x;
            p.y += - self.hi.y / 2. + center.y;
        }
        self
    }

    pub fn build(self) -> Vec<Point> {
        self.points
    }
}

